import React from "react";
import { Basket } from "./basket";

export class Checkout extends React.Component {
  render() {
    const { selectedGame } = this.props;
    return (
      <div className="checkout-container">
        <h1>Checkout</h1>
        {selectedGame && <Basket game={selectedGame} />}
      </div>
    );
  }
}
